import React from "react";

function ProblemTable({ problems }) {
  return (
    <div>
      <h2>Problems by Rating</h2>
      <table>
        <thead>
          <tr>
            <th>Rating</th>
            <th>Problem ID</th>
          </tr>
        </thead>
        <tbody>
          {problems.map((problem) => (
            <tr key={problem.problemId}>
              <td>{problem.rating}</td>
              <td>{problem.problemId}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ProblemTable;
